@WikimediaDE has developed eight requirements for digital policy oriented toward the common good/public interest  cc @lilliiliev

The #IPPR rightly follows Marianna Mazzucato & suggests that UK Govt. needs to invest directly in #greentehcnology;

as I've said before this make perfect sense; not only would it help accelerate the #greentransition, it would also pump-prime the UK's current lamentable #investment environment for #manufacturers... 

Its a policy that the Labour Party should get behind.... its certainly a better use of #taxpayers money than subsidising #fossilfules (see earlier post)

#USA Continues Down Path Toward #War with #China Over #Taiwan

- The US is creating military assistance packages for Taiwan similar to those it creates for Ukraine ahead of a Ukraine-style proxy conflict Washington seeks to create with Beijing; 

- The US is also passing legislation serving as a stepping stone toward pushing its Taiwan proxies toward declaring "independence" and triggering a conflict with the rest of China;
